import React from 'react';
import './Css/Nav.css';
import logo from './Images/HobLogo.jpg';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from "react-router-dom";

function Nav() {
  return (
    <nav>
      <div class="container">
        <div class="row">
          <div class="col-1">
            <img src={logo} className="logo" />
          </div>
          <div class="col-11">
            <ul className="nav-links">
              <Link to="/home">
                 <li style={{textDecoration: "none"}}>Home</li>
                 </Link>
                <Link to="/About">
              <li>About Us</li>
              </Link>
              <Link to="/Login">
              <li>Login</li>
              </Link>
              <Link to="/Upload">
              <li>Upload</li>
              </Link>
            </ul>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
